import React from 'react';

const NavBar = () => {
  return (
    <nav className='navbar '>
      <ul className='navbar-nav mr-auto'>
        <li className='nav-item'>
          <a href='#' className='nav-link'>
            Home
          </a>
        </li>
        <li className='nav-item'>
          <a href='#' className='nav-link'>
            about
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
